package com.personnel.domain.output;/** * @author: Administrator */public class PlateOutput {  private Integer personId;  private String plateNo;  private String name;  private String personNo;  private String phoneNo;  public Integer getPersonId() {    return personId;  }  public void setPersonId(Integer personId) {    this.personId = personId;  }  public String getPlateNo() {    return plateNo;  }  public void setPlateNo(String plateNo) {    this.plateNo = plateNo;  }  public String getName() {    return name;  }  public void setName(String name) {    this.name = name;  }  public String getPersonNo() {    return personNo;  }  public void setPersonNo(String personNo) {    this.personNo = personNo;  }  public String getPhoneNo() {    return phoneNo;  }  public void setPhoneNo(String phoneNo) {    this.phoneNo = phoneNo;  }}